    "2016-05-21T01:39:25.209891",nt"name": "visa-compliance-system",nt"isopen":
    true,nt"url": null,nt"notes": "A new secure web-based system that tracks
    the approval process of the DS-2019 applications and participant information. The
    Office of Education uses VCS to track the foreign national's entry to, and departure
    from, the US, their attendance at training/exchange visitor programs, and to obtain
    the State Department's DS-2019 form in order to apply for a visa for travel to the
    United States. VCS facilitates data interchange between TraiNet and Student and
    Exchange Visitor Information System (SEVIS). VCS performs three functions: First,
    it implements a process to verify data from TraiNet. Second, it translates TraiNet
    data to the format required by SEVIS and manages its transmission. Lastly, it provides
    approval management of requests for applications as they move through the workflow
    process. VCS holds data regarding foreign nationals who receive instruction funded
    by USAID, whose training will take place in the United States, and to request a
    J-1 visa for travel to the United States.",nt"license_title": "Other License
